        "title": {
            "rendered": "India announce Squads against Bangladesh"
        },
        "content": {
            "rendered": "\n<p>\n\nThe Indian national selectors named the T20I and Test squad for the series against Bangladesh on Thursday and skipper Virat Kohli has been rested for the T20I series and Rohit Sharma will lead the team in his absence. While Sanju Samson is the big inclusion in the squad, Rishabh Pant has still been retained as the primary keeper. The Test team sees no major change as Kuldeep Yadav has retained his place.</p>\n\n\n\n<p>Samson&#8217;s name has been doing the rounds in recent times and with the World T20 up next year, the team management as well as the selectors are looking to keep options open as Pant is yet to cement his place in the team in the limited-overs format.</p>\n\n\n\n<p>The fact that Samson stole the headlines with a brilliant double century against Goa in the ongoing Vijay Hazare Trophy also helped his case. Shivam Dube has also been given another opportunity even though it is unlikely that he will get a game.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://blog.stumpguru.com/wp-content/uploads/2019/10/tgch43c8_rohit-sharma-afp_625x300_28_October_19.jpg\" alt=\"India Squad against Bangladesh\" class=\"wp-image-465\" srcset=\"http://blog.stumpguru.com/wp-content/uploads/2019/10/tgch43c8_rohit-sharma-afp_625x300_28_October_19.jpg 806w, http://blog.stumpguru.com/wp-content/uploads/2019/10/tgch43c8_rohit-sharma-afp_625x300_28_October_19-300x225.jpg 300w, http://blog.stumpguru.com/wp-content/uploads/2019/10/tgch43c8_rohit-sharma-afp_625x300_28_October_19-768x576.jpg 768w\" sizes=\"(max-width: 806px) 100vw, 806px\" /></figure>\n\n\n\n<p>Speaking to IANS, sources in the know of developments had said that Kohli would be rested for the T20Is before returning to lead the Test team. &#8220;He will be skipping the T20 series as he has been playing non-stop and needs a break considering that he has been part of the Australia series, the IPL, the World Cup, the tour of West Indies and now the series against South Africa. Managing the workload of the players, especially those playing all formats, is something that is a priority with this team to ensure that the players are fresh and on the top of their game at all times,&#8221; the source had said.</p>\n\n\n\n<p>In the Test team, Kuldeep after complaining of shoulder pain ahead of the Ranchi Test against South Africa is fit and is back in the squad. Even Wriddhiman Saha is fit and in the team after he injured his ring finger on the third evening of the final Test against the Proteas.</p>\n\n\n\n<p>India&#8217;s squad for T20I series against Bangladesh: Rohit Sharma(Capt), Shikhar Dhawan, KL Rahul, Sanju Samson, Shreyas Iyer, Manish Pandey, Rishabh Pant(wk), Washington Sundar, Krunal Pandya, Yuzvendra Chahal, Rahul Chahar, Deepak Chahar, Khaleel Ahmed, Shivam Dube, Shardul Thakur</p>\n\n\n\n<p>India&#8217;s squad for Test series against Bangladesh: Virat Kohli (Capt), Rohit Sharma, Mayank Agarwal, Cheteshwar Pujara, Ajinkya Rahane, Hanuma Vihari, Wriddhiman Saha (wk), R Jadeja, R Ashwin, Kuldeep Yadav, Mohammed Shami, Umesh Yadav, Ishant Sharma, Shubman Gill, Rishabh Pant</p>\n\n\n\n<p>To play our fantasy game, visit&nbsp;<a href=\"http://www.stumpguru.com/\">www.stumpguru.com</a></p>\n\n\n\n<p>For all other stuff follow us on&nbsp;<a href=\"https://www.facebook.com/pg/StumpGuru-197459431156045\">Facebook</a>&nbsp;and&nbsp;<a href=\"https://twitter.com/StumpGuru\">Twitter</a>&nbsp;| Read Other blogs&nbsp;<a href=\"http://blog.stumpguru.com/\">here</a></p>\n\n\n\n<p><br></p>\n<div class='sfsi_Sicons' style='width: 100%; display: inline-block; vertical-align: middle; text-align:left'><div style='margin:0px 8px 0px 0px; line-height: 24px'><span>Please follow and like us:</span></div><div class='sfsi_socialwpr'><div class='sf_subscrbe' style='text-align:left;vertical-align: middle;float:left;width:64px'><a href=\"http://www.specificfeeds.com/widgets/emailSubscribeEncFeed/QitoVXUxOTB4QzdjOFFmYmVOWUpmK0RhNERBVG9mQWVqVHdXYXh1cmdDVE9IalBiVjM