    {
        "id": 459,
        "date": "2019-10-27T16:36:53",
        "date_gmt": "2019-10-27T11:06:53",
        "guid": {
            "rendered": "http://blog.stumpguru.com/?p=459"
        },
        "modified": "2019-10-29T11:07:32",
        "modified_gmt": "2019-10-29T05:37:32",
        "slug": "david-warner-ton-helps-australia-win-1st-t20-against-sl",
        "status": "publish",
        "type": "post",
        "link": "http://blog.stumpguru.com/david-warner-ton-helps-australia-win-1st-t20-against-sl/",
        "title": {
            "rendered": "David Warner Ton helps Australia Win 1st T20 against SL"
        },
        "content": {
            "rendered": "\n<p>A ruthless batting Display by David Warner, scoring a century in the first T20 International played against Sri Lanka resulted in Australia winning the fist T20 game without any hassle. Warner scored a blitzkrieg 100 of just 56 balls taking the Australian total to 233/2 </p>\n\n\n\n<p>This was the hosts&#8217; highest-ever total on home soil and fourth highest overall. Warner smashed an unbeaten 56-ball 100, getting to triple figures in the last ball of the innings as skipper Aaron Finch (64) and the promoted Glenn Maxwell (62) provided the perfect complement to Warner&#8217;s return after a forgettable tour of England in the Ashes.</p>\n\n\n\n<p>This was Warner&#8217;s maiden T20 ton and the destructive batsman hit eight fours and three sixes in his innings.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"http://blog.stumpguru.com/wp-content/uploads/2019/10/1572153584799_G9T2FM56Q.1-2-1-1024x577.jpg\" alt=\"David Warner\" class=\"wp-image-461\" srcset=\"http://blog.stumpguru.com/wp-content/uploads/2019/10/1572153584799_G9T2FM56Q.1-2-1-1024x577.jpg 1024w, http://blog.stumpguru.com/wp-content/uploads/2019/10/1572153584799_G9T2FM56Q.1-2-1-300x169.jpg 300w, http://blog.stumpguru.com/wp-content/uploads/2019/10/1572153584799_G9T2FM56Q.1-2-1-768x433.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure>\n\n\n\n<p>Steve Smith did not have to bat as the Aussies took the Sri Lankan bowlers to the cleaners to post 233/2 in 20 overs after visiting captain Lasith Malinga elected to field first.</p>\n\n\n\n<p>Warner and Finch shared an opening wicket partnership of 122 runs while the former associated with Maxwell for another 107 runs.</p>\n\n\n\n<p>For Sri Lanka, Lakshan Sandakan and Dasun Shanaka took one wicket each.</p>\n\n\n\n<p>Chasing a daunting 234 for victory, Sri Lankan batsmen gave a poor account of themselves and could manage 99/9 in 20 overs. Adam Zampa returned the best figures of 3/14 as pace spearhead Mitchell Starc (2/18) and strike bowler Pat Cummins 2/27) grabbed two wickets each. Shanaka top-scored for the islanders with 17.</p>\n\n\n\n<p>Brief scores: Australia 233/2 in 20 overs (David Warner 100*, Aaron Finch 64, Glenn Maxwell 62; Sri Lanka 99/9 in 20 overs (Dasun Shanaka 17; Adam Zampa 3/14) </p>\n\n\n\n<p>To play our fantasy game, visit&nbsp;<a href=\"http://www.stumpguru.com/\">www.stumpguru.com</a></p>\n\n\n\n<p>For all other stuff follow us on&nbsp;<a href=\"https://www.facebook.com/pg/StumpGuru-197459431156045\">Facebook</a>&nbsp;and&nbsp;<a href=\"https://twitter.com/StumpGuru\">Twitter</a>&nbsp;| Read Other blogs&nbsp;<a href=\"http://blog.stumpguru.com/\">here</a></p>\n<div class='sfsi_Sicons' style='width: 100%; display: inline-block; vertical-align: middle; text-align:left'><div style='margin:0px 8px 0px 0px; line-height: 24px'><span>Please follow and like us:</span></div><div class='sfsi_socialwpr'><div class='sf_subscrbe' style='text-align:left;vertical-align: middle;float:left;width:64px'><a href=\"http://www.specificfeeds.com/widgets/emailSubscribeEncFeed/QitoVXUxOTB4QzdjOFFmYmVOWUpmK0RhNERBVG9mQWVqVHdXYXh1cmdDVE9IalBiVjMySWZ4a3dyMmZTeHgrQWZVMzhyK0hmRVdINTEwd0tuTUZlbGFiVjhVYVhVeXpSYWRRd3ptOURkb1B5OGxWelJBd1h3U2lIWURkWnl0VHB8bFIwQXU4T3ZSTUdDLzRVZ1VLaFV2NW1HM0hqWFhvVkdtSE5xZmhDZW5vTT0=/OA==/\" target=\"_blank\"><img src=\"http://blog.stumpguru.com/wp-content/plugins/ultimate-social-media-icons/images/follow_subscribe.png\" /></a></div><div class='sf_fb' style='text-align:left;vertical-align: middle;width:98px'><div class=\"fb-like\" href=\"http://blog.stumpguru.com/david-warner-ton-helps-australia-win-1st-t20-against-sl/\" width=\"180\" send=\"false\" showfaces=\"false\"  action=\"like\" data-share=\"true\"data-layout=\"button\" ></div></div><div class='sf_twiter' style='text-align:left;float:left;vertical-align: middle;width:auto'><a href=\"http://twitter.com/share\" data-count=\"none\" class=\"sr-twitter-button twitter-share-button\" lang=\"en\" data-url=