        "modified": "2019-10-28T16:26:10",
        "modified_gmt": "2019-10-28T10:56:10",
        "slug": "ranchi-test-india-win-the-series-3-0-after-strong-bowling-show",
        "status": "publish",
        "type": "post",
        "link": "http://blog.stumpguru.com/ranchi-test-india-win-the-series-3-0-after-strong-bowling-show/",
        "title": {
            "rendered": "Ranchi Test: India Win the Series 3-0 after strong bowling show"
        },
        "content": {
            "rendered": "\n<p>Ranchi Test: India&#8217;s bowlers, led by Mohammed Shami, pushed Virat Kohli and boys to win the 3-0 whitewash as South Africa were left tottering at 132/8 at stumps on Day 3 and took just a couple of overs on day 4 to bowl out the South African line-up after following on in the third and final Test at the JSCA Stadium on Monday.</p>\n\n\n\n<p>Earlier on Day 3, Dean Elgar&#8217;s concussion substitute Theunis de Bruyn was batting on 30 with Anrich Nortje (5) for company. While Shami has figures of 3/10 in the second innings, Umesh Yadav has picked two as the Indian pacers once again dominated the show.</p>\n\n\n\n<p>Bundled out for just 162 in the first innings, the Proteas were forced to follow on and they trail India by 203 runs with just two wickets in the bag in their second essay. While bad light did force the players to go off the field after the Indians asked for an extra 30 minutes at the fall of the eighth wicket, the South Africans only delayed their defeat for a day.</p>\n\n\n\n<p>To make matters worse for the Proteas, Elgar had to retire hurt post a knock on the helmet by a rising Umesh delivery just before the Tea break. India too had an injury concern as Wriddhiman Saha got hit on the ring finger of his left hand late and was replaced by Rishabh Pant in the last session of the day.</p>\n\n\n\n<p>Earlier, a total of 16 wickets fell on Monday after South Africa resumed at 9/2. Umesh returned with figures of 3/40 in the first essay while Shami, debutant Shahbaz Nadeem, and Ravindra Jadeja all scalped two wickets apiece. Ace off-spinner Ravichandran Ashwin, however, remained wicketless. For the tourists, Zubayr Hamza top-scored with 62.</p>\n\n\n\n<p>Following on, there was no respite for the visitors as it was Shami who once again looked in lethal rhythm. He clean-bowled Hamza (0) first and then trapped skipper Faf du Plessis (4) in front as the score read 18/3. But the pacer wasn&#8217;t done and then sent back Temba Bavuma for a duck, caught behind by wicketkeeper Wriddhiman Saha.</p>\n\n\n\n<p>But the slide was started by Umesh when he sent opener Quinton de Kock&#8217;s off-stump cartwheeling with a beauty as the Proteas T20I skipper played inside the line of the ball. At the tea break, South Africa were 26/4.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://blog.stumpguru.com/wp-content/uploads/2019/10/ind-vs-rsa-3rd-test_419d39d2-f471-11e9-a1e4-7f5be0e43c85.jpg\" alt=\"Ranchi Test\" class=\"wp-image-457\" srcset=\"http://blog.stumpguru.com/wp-content/uploads/2019/10/ind-vs-rsa-3rd-test_419d39d2-f471-11e9-a1e4-7f5be0e43c85.jpg 960w, http://blog.stumpguru.com/wp-content/uploads/2019/10/ind-vs-rsa-3rd-test_419d39d2-f471-11e9-a1e4-7f5be0e43c85-300x171.jpg 300w, http://blog.stumpguru.com/wp-content/uploads/2019/10/ind-vs-rsa-3rd-test_419d39d2-f471-11e9-a1e4-7f5be0e43c85-768x437.jpg 768w\" sizes=\"(max-width: 960px) 100vw, 960px\" /></figure>\n\n\n\n<p>In the morning session, the tourists had the worst possible start as they lost skipper du Plessis to a peach of a delivery by Umesh. Overnight-batsman Hamza, however, opted for counter-attacking technique thereafter and along with Bavuma, scored freely and made sure the visitors didn&#8217;t succumb to the pressure applied by the Indian bowlers.</p>\n\n\n\n<p>Both Hamza and Bavuma collected boundaries at regular intervals and kept the scoreboard moving. During the 91-run partnership, the 24-year-old Hamza went to score his maiden Test 50.</p>\n\n\n\n<p>However, just when South Africa were looking like getting back into the game, Jadeja bowled a ripper to get past the bat of Hamza and brought an end to his 62-run knock. Bavuma didn&#8217;t stay long at the crease thereafter and became the first international scalp of debutant Shahbaz Nadeem at his individual score of 32.</p>\n\n\n\n<p>Wicketkeeper Heinrich Klaasen, who came in next, didn&#8217;t trouble the scorers much and was bowled by Jadeja after contributing with six runs to South Africa total.</p>\n\n\n\n<p>Rohit Sharma was adjudged Man of the Series and Man of the Match for his brilliant batting display!</p>\n\n\n\n<p>To play our fantasy game, visit&nbsp;<a href=\"http://www.stumpguru.com/\">www.stumpguru.com</a></p>\n\n\n\n<p>For all other stuff follow us on&nbsp;<a href=\"https://www.facebook.com/pg/StumpGuru-197459431156045\">Facebook</a>&nbsp;and&nbsp;<a href=\"https://twitter.com/StumpGuru\">Twitter</a>&nbsp;| Read Other blogs&nbsp;<a href=\"http://blog.stumpguru.com/\">here</a></p>\n\n\n\n<p><br></p>\n<div class='sfsi_Sicons' style='width: 100%; display: inline-block; vertical-align: middle; text-align:left'><div style='margin:0px 8px 0px 0px; line-height: 24px'><span>Please follow and like us:</span></div><div class='sfsi_socialwpr'><div class='sf_subscrbe' style='text-align:left;vertical-align: middle;float:left;width:64px'><a href=\"http://www.specificfeeds.com/widgets/emailSubscribeEncFeed/QitoVXUxOTB4QzdjOFFmYmVOWUpmK0RhNERBVG9mQWVqVHdXYXh1cmdDVE9IalBiVjMySWZ4a3dyMmZTeHgrQWZVMzhyK0hmRVdINTEwd0tuTUZlbGFiVjhVYVhVeXpSYWRRd3ptOURkb1B5OGxWelJBd1h3U2lIWURkWnl0VHB8bFIwQXU4T3ZSTUdDLzRVZ1VLaFV2NW1HM0hqWFhvVkdtSE5xZmhDZW5vTT0=/OA==/\" target=\"_blank\"><img src=\"http://blog.stumpguru.com/wp-content/plugins/ultimate-social-media-icons/images/follow_subscribe.png\" /></a></div><div class='sf_fb' style='text-align:left;vertical-align: middle;width:98px'><div class=\"fb-like\" href=\"http://blog.stumpguru.com/ranchi-test-india-win-the-series-3-0-after-strong-bowling-show/\" width=\"180\" send=\"false\" showfaces=\"false\"  action=\"like\" data-share=\"true\"data-layout=\"button\" ></div></div><div class='sf_twiter' style='text-align:left;float:left;vertical-align: middle;width:auto'><a href=\"http://twitter.com/share\" data-count=\"none\" class=\"sr-twitter-button twitter-share-button\" lang=\"en\" data-url=\"http://blog.stumpguru.com/ranchi-test-india-win-the-series-3-0-after-strong-bowling-show/\" data-text=\"Ranchi Test: India 